public void syncFusedCancelAfterRequest() {
    final TestSubscriber<Integer> ts = new TestSubscriber<Integer>(2L) {
        @Override
        public void onNext(Integer t) {
            super.onNext(t);
            if (t == 2) {
                cancel();
                onComplete();
            }
        }
    };

    Flowable.range(1, 3)
    .observeOn(Schedulers.single())
    .subscribe(ts);

    ts
    .awaitDone(5, TimeUnit.SECONDS)
    .assertResult(1, 2);
}

